import React, {Component} from "react";
import "./Skills.css";
import pyth from "./assets/experience/python_circle.png"
import cplusplus from "./assets/experience/c++_circle.png"

class Skills extends Component{
	render() {
		return (
			<div id = "Skills">
				<h1 className = "title"><my className = "my">MY</my> EXPERIENCES</h1>
				<div className = "exp">
					<h1 className = "lang">LANGUAGES</h1>
					<h1 className = "techn">TECHNOLOGIES</h1>
					<h1 className = "skills">SKILLS</h1>
				</div>
				<div className = "exp">
					<div className = "languages">
						<div className = "icons">
							<img className = "icon"
							 src = {pyth}
							 />
							 	<h2 className = "languages">Python</h2>
						 </div>
						 <div className = "icons">
							<img className = "icon"
							 src = {cplusplus}
							 />
							 	<h2 className = "languages">C++</h2>
						 </div>
					 </div>
					 <div className = "technologies">
					 </div>
					 <div className = "skill">
					 </div>
				</div>
			</div>

		);
	}
}

export default Skills;
